// src/Pages/User/SubmitFeedback.js
import React, { useState } from "react";
import "./SubmitFeedback.css";

export default function SubmitFeedback() {
  const [mentor, setMentor] = useState("");
  const [week, setWeek] = useState("");
  const [hours, setHours] = useState("");
  const [queries, setQueries] = useState("");
  const [openQueries, setOpenQueries] = useState("");
  const [linesOfCode, setLinesOfCode] = useState("");
  const [rating, setRating] = useState(1);

  const handleSubmit = async (e) => {
    e.preventDefault();

    const feedbackData = {
      mentorName: mentor,
      week,
      hours,
      queries,
      openQueries,
      description: linesOfCode,
      rating,
      status: "Pending",
      userId: localStorage.getItem("userId"),
    };

    try {
      const res = await fetch("https://localhost:7079/api/feedback", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(feedbackData),
      });

      if (!res.ok) throw new Error("Failed to submit feedback");
      alert("Feedback submitted successfully!");
    } catch (err) {
      alert("Error submitting feedback");
      console.log(err);
    }
  };

  return (
 
    <form onSubmit={handleSubmit}>
         <h2 style={{ margin: "0 0 12px 0", color: "#5a4632", textAlign: "center" }}>
        Freshers 2025 - AppDev - Feedback survey about your Mentor
      </h2>

      <label>Your Mentor full name</label>
      <input
        type="text"
        value={mentor}
        onChange={(e) => setMentor(e.target.value)}
        required
      />

      <label>Choose the Week you are providing review for</label>
      <select value={week} onChange={(e) => setWeek(e.target.value)} required>
        <option value="">Select Week</option>
        <option value="Week 1">Week 1</option>
        <option value="Week 2">Week 2</option>
        <option value="Week 3">Week 3</option>
        <option value="Week 4">Week 4</option>
        <option value="Week 5">Week 5</option>
        <option value="Week 6">Week 6</option>
        <option value="Week 7">Week 7</option>
        <option value="Week 8">Week 8</option>
        <option value="Week 9">Week 9</option>
        <option value="Week 10">Week 10</option>
        <option value="Week 11">Week 11</option>
        <option value="Week 12">Week 12</option>
      </select>

      <label>Approximately how many hours did your mentor spend with you this week?</label>
      <input
        type="number"
        value={hours}
        onChange={(e) => setHours(e.target.value)}
        min="1"
        max="10"
        required
      />

      <label>Did your mentor answer all your questions this week?</label>
      <select
        value={queries}
        onChange={(e) => setQueries(e.target.value)}
        required
      >
        <option value="">-- Select --</option>
        <option value="Yes">Yes</option>
        <option value="No">No</option>
      </select>

      <label>If you have open queries, please describe them here (Type NA if no queries)</label>
      <input
        type="text"
        value={openQueries}
        onChange={(e) => setOpenQueries(e.target.value)}
      />

      <label>How many lines of code did you write this week?</label>
      <input
        type="text"
        value={linesOfCode}
        onChange={(e) => setLinesOfCode(e.target.value)}
      />

      <label>Overall, how would you rate your mentoring experience this week?</label>
      <select value={rating} onChange={(e) => setRating(e.target.value)}>
        <option value={1}>⭐</option>
        <option value={2}>⭐⭐</option>
        <option value={3}>⭐⭐⭐</option>
        <option value={4}>⭐⭐⭐⭐</option>
        <option value={5}>⭐⭐⭐⭐⭐</option>
      </select>

      <button type="submit">Submit Feedback</button>
    </form>
  );
}
